import { Squash as Hamburger } from "hamburger-react";

const show = () =>
  document.getElementById("filter-dropdown").classList.remove("invisible");
const hide = () =>
  document.getElementById("filter-dropdown").classList.add("invisible");

const Menubutton = () => {
  <div id="menu-button">
    <Hamburger
      rounded
      size={24}
      onToggle={(toggled) => {
        toggled === true ? show : hide;
      }}
    />
  </div>;
};

export default Menubutton;
